import React from 'react';
import './Boxes.css';

const Boxes = (box) => {
    console.log(box)
    return(
        <div 
            className='bounding-box2' 
            style={{
                top:box.topRow, 
                right: box.rightCol, 
                left: box.leftCol, 
                bottom:box.bottomRow
            }}
        ></div>
    )
} 

export default Boxes;
